import { categories } from "../data/category";
import { product } from "../data/product";
import classes from "./Shop.module.css";
function Shop(){
    return <div className={classes.container}>
        <div className={classes.row}>
            <h1>Shop của Hoài Huy</h1>
            {
                categories.map(cate => <div className={classes.cat} key={cate.id}>
                    {cate.name}
                </div>)
            }
        </div>
        <div className={classes.row}>
            <div className={classes.left}><h2>Danh mục sản phẩm</h2></div>
            <div className={classes.right}><h2>Sản phẩm</h2></div>
        </div>
    </div>
}
export default Shop;
